css:
.editor {
  background-color: #191b26;
  color: #cccccc;
}
.editor .gutter {
  background-color: #191b26;
  color: #cccccc;
}
.editor .gutter .line-number.cursor-line {
  background-color: #393939;
  color: #cccccc;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #cccccc;
}
.editor .wrap-guide {
  color: #6a6a6a;
}
.editor .indent-guide {
  color: #6a6a6a;
}
.editor .invisible-character {
  color: #6a6a6a;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: #6a6a6a;
}
.editor .search-results .marker.current-result .region {
  border: #cccccc;
}
.editor.is-focused .cursor {
  border-color: #cccccc;
}
.editor.is-focused .selection .region {
  background-color: #515151;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: #393939;
}
.comment {
  color: #999999;
}
.invalid {
  font-weight: bold;
  color: #FFF9F9;
  background-color: #FF0000;
}
.keyword.operator.class,
.constant.other,
.source.php.embedded.line {
  color: #CCCCCC;
}
.support.other.variable,
.string.other.link,
.entity.name.tag,
.meta.tag,
.declaration.tag {
  color: #73A0F5;
}
.variable {
  color: #ACFFAE;
}
.variable.other.property.php {
  color: #DCF87E;
}
.keyword.other.create.sql {
  color: #F2C984;
}
.storage.type.sql {
  color: #BFA577;
}
.storage.modifier.sql {
  color: #B86741;
}
.constant.other.database-name.sql {
  color: #E11717;
}
.markup.list.numbered.markdown {
  color: #509BA9;
}
.markup.list.unnumbered.markdown {
  color: #7D9BAE;
}
.markup.bold.markdown {
  font-weight: bold;
}
.markup.italic.markdown {
  font-style: italic;
}
.punctuation.definition.italic.markdown,
.punctuation.definition.bold.markdown {
  color: #6B72A0;
}
.punctuation.definition.raw.markdown {
  color: #FFFFFF;
}
.markup.raw.inline.markdown,
.markup.raw.block.markdown {
  color: #6B72A0;
}
.meta.block-level.markdown {
  color: #6B72A0;
}
.punctuation.definition.blockquote.markdown {
  color: #F09D59;
}
.punctuation.definition.link.markdown {
  color: #6789E2;
}
.string.other.link.description.markdown,
.string.other.link.title.markdown {
  color: #BDE77E;
}
.markup.underline.link.image.markdown,
.meta.link.inline.markdown {
  color: #308F1F;
}
.string.other.link.description.title.markdown {
  color: #7AB048;
}
.constant.other.reference.link.markdown {
  color: #77884A;
}
.constant.numeric,
.constant.language,
.support.constant,
.constant.character,
.punctuation.section.embedded,
.keyword.other.unit {
  color: #ECAB84;
}
.punctuation.section.embedded {
  color: #FF3E3E;
}
.source.php.embedded.line.html {
  background-color: #343434;
}
.string.regexp,
.string.regexp.single-quoted.php,
.string.regexp.double-quoted.php {
  color: #8080FF;
}
.string.regexp.character-class.php {
  color: #B99DF2;
}
.string.regexp.arbitrary-repitition.php {
  color: #5050B8;
}
.entity.name.class,
.entity.name.type.class,
.support.type,
.support.class,
.entity.name {
  color: #FFCC66;
}
.string,
.constant.other.symbol,
.entity.other.inherited-class,
.markup.heading {
  color: #84C2FF;
}
.keyword.operator,
.constant.other.color {
  color: #FACC7A;
}
.entity.name.function,
.meta.function-call,
.support.function,
.keyword.other.special-method,
.meta.block-level {
  color: #73A0F5;
}
.keyword,
.storage,
.storage.type {
  color: #F29940;
}
.invalid {
  color: #CDCDCD;
  background-color: #F2777A;
}
.meta.separator {
  color: #CDCDCD;
  background-color: #313131;
}
.invalid.deprecated {
  color: #CDCDCD;
  background-color: #CC99CC;
}
.markup.inserted.diff,
.markup.deleted.diff,
.meta.diff.header.to-file,
.meta.diff.header.from-file {
  color: #FFFFFF;
}
.markup.inserted.diff,
.meta.diff.header.to-file {
  color: #718c00;
}
.markup.deleted.diff,
.meta.diff.header.from-file {
  color: #c82829;
}
.meta.diff.header.from-file,
.meta.diff.header.to-file {
  color: #FFFFFF;
  background-color: #4271ae;
}
.meta.diff.range {
  font-style: italic;
  color: #3e999f;
}
.invalid.trailing-whitespace {
  background-color: #F93232;
}
.source.js {
  color: #D8EBED;
}
.punctuation.definition.parameters.begin.js,
.punctuation.definition.parameters.end.js,
.meta.brace.round.js,
.meta.brace.curly.js {
